import Menu from './menu';

export default function Community() {
  
  return (
    <>
      {/*가장 바깥영역 화면의 최대로 설정*/}
      <div className="grid grid-cols-1 grid-rows-9 sm:grid-rows-1 sm:grid-cols-sm-minmax sm:grid-cols-9 h-screen">
        {/* 왼쪽: 가로 1 비율 (1/9) */}
        <Menu current_src ={2}/>
